import React from 'react';
import { Link } from 'react-router-dom';
import Footer from '../components/Footer';
import Header from '../components/Header';

export default function Profile() {
  const className = 'border-2 w-1/4 mx-2 p-2 border-primary rounded-md hover:text-gray-50 hover:bg-primary transition duration-300 ease-in-out transform  focus:bg-primary focus:text-gray-50'
  return (
    <div className="h-screen">
      <div>
        <Header searchRender={ false } title="Perfil" />
      </div>
      <section className="mt-4">
        <h3 data-testid="profile-email">
          { localStorage.getItem('user')
      && JSON.parse(localStorage.getItem('user')).email}

        </h3>
        <Link to="/receitas-feitas">
          <button
            type="button"
            // onClick={ handleClick }
            className={ className }
            data-testid="profile-done-btn"
          >
            Receitas Feitas
          </button>
        </Link>
        <Link to="/receitas-favoritas">
          <button
            type="button"
            className={ className }
            data-testid="profile-favorite-btn"
          >
            Receitas Favoritas
          </button>
        </Link>

        <Link to="/">
          <button
            type="button"
            onClick={ () => localStorage.clear() }
            className={ className }
            data-testid="profile-logout-btn"
          >
            Sair
          </button>
        </Link>
      </section>
      <div>
        <Footer />
      </div>
    </div>
  );
}
